import React, { Component, Fragment } from 'react';
import './Blog.css';

const Blog = function () {
    return <Fragment>
        <section id="blog">
            <h2>Blog</h2>
            <div id="post-container">
                <div class="post"></div>
                <div class="post"></div>
                <div class="post"></div>
            </div>
        </section>
    </Fragment>;
}

export default Blog;
